import './ExpenseItem.css';

function ExpenseItem(){

return(

    <div>
        <div className='expense-item'>March 12 2021</div>
        <div className='expense-item-description'><h2>Car Insurance</h2>
      <div className='expense-item-price'>200$</div>
        </div>
    </div>
);
}

export default ExpenseItem;
